import React from "react";
import { Link } from "react-router-dom";
import dayjs from "dayjs";

const columns = [
  {
    name: "Name",
    sortable: true,
    selector: "name",
    cell: (row) => (
      <div data-tag="allowRowEvents">
        <Link
          to={{
            pathname: `listeningaids/edit/${row._id}`,
          }}
        >
          {row.name}
        </Link>
      </div>
    ),
  },
  {
    name: "Brand",
    selector: "brand",
    sortable: true,
  },
  {
    name: "price",
    selector: "price",
    sortable: true,
  },
  {
    name: "Case No.",
    selector: "caseNo",
    sortable: true,
  },
];

export default columns;
